package com.axp.service.money.impl;import java.util.List;import org.springframework.stereotype.Service;import com.axp.model.SellerMoneyRecord;import com.axp.service.money.AssetService;import com.axp.service.system.impl.BaseServiceImpl;@Servicepublic class AssetServiceImpl extends BaseServiceImpl implements AssetService {		@Override	public Double getSellerPreMoney(Integer sellerId){		return sellerMoneyRecordDao.getDisComfirmedSum(sellerId);	}		@Override	public List<SellerMoneyRecord> getRecordsByConfirmed(Integer sellerId, Boolean isConfirmed){		return sellerMoneyRecordDao.getRecordsByConfirmed(sellerId, isConfirmed);	}	}